import React, {memo} from 'react';
import styled from 'styled-components';

const PalksStoryContainer = styled.div`
    background-color: #0f6;
`;

const PalksStory = memo(() => {
  return (
    <PalksStoryContainer>
      <h1>content</h1>
    </PalksStoryContainer>
  );
});

export default PalksStory;
